                "sentence":"Entertainment Weekly ( sometimes abbreviated as EW ) is an American monthly entertainment magazine based in New York City , published by Meredith Corporation , that covers film , television , music , Broadway theatre , books , and popular culture . The magazine debuted on February 16 , 1990 , in New York City . Different from celebrity-focused publications such as `` Us Weekly `` , `` People `` ( a sister magazine to `` EW '' ) , and `` In Touch Weekly `` , `` EW '' primarily concentrates on entertainment media news and critical reviews . However , unlike `` Variety `` and `` The Hollywood Reporter `` , which are aimed at industry insiders , `` EW '' targets a more general audience . Formed as a sister magazine to `` People '' , the first issue of `` Entertainment Weekly '' was published on February 16 , 1990 .",
