                "sentence":"Seattle Slew later became an outstanding sire and broodmare sire , leading the North American sire list in 1984 when his son Swale won the Kentucky Derby and Belmont Stakes . Another son , AP Indy , won the Belmont Stakes and continued the sire line through descendants such as Mineshaft , Tapit , and California Chrome . Seattle Slew was a dark bay horse with a small white patch of hair by his left rear hoof . He was bred by Ben S Castleman , a Kentucky racing commissioner , and was foaled at White Horse Acres near Lexington , Kentucky . Seattle Slew was the first foal out of My Charmer , a stakes-winning daughter of the otherwise obscure sire Poker .",
